import styled from 'styled-components';

export const Head3 = styled.h3`
	margin:    7rem 0 3rem 0;	
	font-size: 3rem;
	color: var(--lightGray);
	font-weight: 500;
	@media (max-width: 768px) {
    flex-direction: column;
    font-size: 2em;
    padding-bottom: 3rem;
`;
